INSERT INTO `artgallery_gallery` (`id`, `title`, `description`, `created_at`, `banner`) VALUES
(1, 'Modern UI Designs', 'Explore a collection of modern UI designs inspired by Material Design principles. From sleek layouts to vibrant color palettes, discover innovative interfaces that elevate user experiences.', '2023-07-15 09:30:00.000000', 'banner1.png'),
(2, 'Interactive UX Concepts', 'Dive into interactive UX concepts that push the boundaries of user engagement. From fluid animations to intuitive gestures, witness cutting-edge designs that captivate and delight users.', '2023-08-20 11:45:00.000000', 'banner2.png'),
(3, 'Minimalist Interface Showcase', 'Discover the beauty of minimalist interfaces designed for maximum impact. With clean typography and simple interactions, these interfaces focus on clarity and usability.', '2023-09-25 14:20:00.000000', 'banner3.png'),
(4, 'Elegant UI Components', 'Explore a curated collection of elegant UI components crafted for seamless integration. From buttons to sliders, each component is meticulously designed to enhance the overall user experience.', '2023-10-30 16:00:00.000000', 'banner4.png'),
(5, 'User-Centric Design Inspirations', 'Get inspired by user-centric design inspirations that prioritize the needs and preferences of users. From personalized experiences to inclusive designs, discover innovative approaches to UX.', '2023-11-05 18:10:00.000000', 'banner5.png'),
(6, 'Mobile App UI Trends', 'Stay ahead of the curve with the latest mobile app UI trends shaping the industry. From dark mode designs to gesture-based interactions, explore the future of mobile interfaces.', '2023-12-10 20:30:00.000000', 'banner6.jpg'),
(7, 'Interactive Web Experiences', 'Immerse yourself in interactive web experiences designed to engage and entertain users. From scroll-triggered animations to parallax effects, these websites redefine user engagement.', '2024-01-15 22:15:00.000000', 'banner7.png'),
(8, 'Accessible UX Design Showcase', 'Experience the power of accessible UX design showcased through inclusive interfaces. With features like keyboard navigation and screen reader compatibility, these designs prioritize accessibility for all users.', '2024-02-20 09:00:00.000000', 'banner8.png'),
(9, 'Creative UI Animations', 'Witness the magic of creative UI animations that bring interfaces to life. From micro-interactions to animated transitions, these designs add personality and charm to user interactions.', '2024-03-25 11:30:00.000000', 'banner9.gif'),
(10, 'Responsive Design Inspirations', 'Explore responsive design inspirations that adapt seamlessly to various devices and screen sizes. With flexible layouts and fluid grids, these designs ensure a consistent user experience across platforms.', '2024-04-30 13:45:00.000000', 'banner10.jpg');
