INSERT INTO `codereview_codesnippet` (`id`, `title`, `description`, `code`, `github_link`, `language`, `created_at`, `likes`, `dislikes`, `user_id`) VALUES
(4, 'Python Data Analysis', 'Exploratory data analysis using Python libraries such as Pandas and Matplotlib.', 'import pandas as pd\nimport matplotlib.pyplot as plt\n\n# Load data\ndata = pd.read_csv(\"data.csv\")\n\n# Analyze data\n...\n\n# Visualize data\nplt.plot(data[\"x\"], data[\"y\"])\nplt.show()', 'https://github.com/user/repo1', 'python', '2024-04-20 00:00:00.000000', 0, 0, 1),
(5, 'JavaScript Web App', 'Building a simple web application using JavaScript and HTML/CSS.', '<html>\n  <head>\n    <title>My Web App</title>\n    <script src=\"app.js\"></script>\n  </head>\n  <body>\n    <h1>Hello, world!</h1>\n  </body>\n</html>', 'https://github.com/user/repo2', 'javascript', '2024-04-19 00:00:00.000000', 0, 0, 2),
(6, 'Java Database Connection', 'Connecting Java application to a MySQL database.', 'import java.sql.Connection;\nimport java.sql.DriverManager;\n\n// Establish connection\nConnection conn = DriverManager.getConnection(\"jdbc:mysql://localhost:3306/mydb\", \"username\", \"password\");\n\n// Execute queries\n...', 'https://github.com/user/repo3', 'java', '2024-04-18 00:00:00.000000', 0, 0, 3),
(7, 'Ruby API Development', 'Building a RESTful API using Ruby on Rails framework.', 'rails new my_api\n\n# Define routes and controllers\nrails generate controller UsersController\n\n# Define models\nrails generate model User name:string email:string\n\n# Migrate database\nrails db:migrate', 'https://github.com/user/repo4', 'Ruby', '2024-04-17 00:00:00.000000', 0, 0, 4),
(8, 'C++ Data Structures', 'Implementation of common data structures in C++.', '#include <iostream>\n#include <vector>\n\nusing namespace std;\n\n// Define data structures\nstruct Node {\n    int data;\n    Node* next;\n};\n\nint main() {\n    // Code implementation\n    ...\n\n    return 0;\n}', 'https://github.com/user/repo5', 'cpp', '2024-04-16 00:00:00.000000', 0, 0, 5),
(9, 'Python Machine Learning', 'Implementation of machine learning algorithms in Python.', 'from sklearn import datasets\nfrom sklearn.model_selection import train_test_split\nfrom sklearn.neighbors import KNeighborsClassifier\n\n# Load dataset\niris = datasets.load_iris()\nX_train, X_test, y_train, y_test = train_test_split(iris.data, iris.target, test_size=0.2, random_state=42)\n\n# Train model\nknn = KNeighborsClassifier(n_neighbors=3)\nknn.fit(X_train, y_train)\n\n# Make predictions\npredictions = knn.predict(X_test)', 'https://github.com/user/repo6', 'python', '2024-04-15 00:00:00.000000', 0, 0, 6),
(10, 'JavaScript Animation', 'Creating animations using JavaScript and CSS.', 'document.getElementById(\"myElement\").style.animation = \"mymove 4s infinite\";', 'https://github.com/user/repo7', 'javascript', '2024-04-14 00:00:00.000000', 0, 0, 7),
(11, 'Java Swing GUI', 'Building a simple GUI application using Java Swing library.', 'import javax.swing.*;\n\npublic class MyGUI {\n    public static void main(String[] args) {\n        JFrame frame = new JFrame(\"My GUI\");\n        JButton button = new JButton(\"Click me\");\n        frame.add(button);\n        frame.setSize(300, 200);\n        frame.setVisible(true);\n    }\n}', 'https://github.com/user/repo8', 'java', '2024-04-13 00:00:00.000000', 0, 0, 8),
(12, 'PHP Web Development', 'Building a dynamic website using PHP and MySQL.', '<?php\n// Connect to database\n$conn = mysqli_connect(\"localhost\", \"username\", \"password\", \"mydb\");\n\n// Retrieve data from database\n$query = \"SELECT * FROM users\";\n$result = mysqli_query($conn, $query);\n\n// Display data\nwhile ($row = mysqli_fetch_assoc($result)) {\n    echo \"Name: \" . $row[\"name\"] . \"<br>\";\n}\n\n// Close connection\nmysqli_close($conn);\n?>', 'https://github.com/user/repo9', 'PHP', '2024-04-12 00:00:00.000000', 0, 0, 9),
(13, 'Swift iOS App', 'Building a simple iOS app using Swift programming language.', 'import UIKit\n\nclass ViewController: UIViewController {\n\n    override func viewDidLoad() {\n        super.viewDidLoad()\n        // Do any additional setup after loading the view.\n    }\n\n}', 'https://github.com/user/repo10', 'swift', '2024-04-11 00:00:00.000000', 0, 0, 10),
(14, 'React Native App', 'Building a mobile app using React Native framework.', 'import React from \"react\";\nimport { View, Text, StyleSheet } from \"react-native\";\n\nconst App = () => {\n  return (\n    <View style={styles.container}>\n      <Text>Hello, world!</Text>\n    </View>\n  );\n};\n\nconst styles = StyleSheet.create({\n  container: {\n    flex: 1,\n    justifyContent: \"center\",\n    alignItems: \"center\",\n  },\n});\n\nexport default App;', 'https://github.com/user/repo11', 'javascript', '2024-04-10 00:00:00.000000', 0, 0, 11),
(15, 'Python Web Scraping', 'Scraping data from websites using Python libraries like BeautifulSoup.', 'import requests\nfrom bs4 import BeautifulSoup\n\n# Send request to the website\nresponse = requests.get(\"https://example.com\")\n\n# Parse HTML content\nsoup = BeautifulSoup(response.content, \"html.parser\")\n\n# Extract information\n...', 'https://github.com/user/repo12', 'python', '2024-04-09 00:00:00.000000', 0, 0, 12),
(16, 'C# Unity Game Development', 'Building a game using C# programming language and Unity game engine.', 'using UnityEngine;\n\npublic class PlayerController : MonoBehaviour\n{\n    public float speed = 5f;\n\n    void Update()\n    {\n        float horizontal = Input.GetAxis(\"Horizontal\");\n        float vertical = Input.GetAxis(\"Vertical\");\n\n        Vector3 movement = new Vector3(horizontal, 0, vertical);\n        transform.Translate(movement * speed * Time.deltaTime);\n    }\n}', 'https://github.com/user/repo13', 'csharp', '2024-04-08 00:00:00.000000', 0, 0, 13),
(17, 'JavaScript Chart Visualization', 'Creating interactive charts using JavaScript libraries like Chart.js.', 'var ctx = document.getElementById(\"myChart\").getContext(\"2d\");\nvar myChart = new Chart(ctx, {\n    type: \"bar\",\n    data: {\n        labels: [\"Red\", \"Blue\", \"Yellow\", \"Green\", \"Purple\", \"Orange\"],\n        datasets: [{\n            label: \"# of Votes\",\n            data: [12, 19, 3, 5, 2, 3],\n            backgroundColor: [\n                \"rgba(255, 99, 132, 0.2)\",\n                \"rgba(54, 162, 235, 0.2)\",\n                \"rgba(255, 206, 86, 0.2)\",\n                \"rgba(75, 192, 192, 0.2)\",\n                \"rgba(153, 102, 255, 0.2)\",\n                \"rgba(255, 159, 64, 0.2)\"\n            ],\n            borderColor: [\n                \"rgba(255, 99, 132, 1)\",\n                \"rgba(54, 162, 235, 1)\",\n                \"rgba(255, 206, 86, 1)\",\n                \"rgba(75, 192, 192, 1)\",\n                \"rgba(153, 102, 255, 1)\",\n                \"rgba(255, 159, 64, 1)\"\n            ],\n            borderWidth: 1\n        }]\n    },\n    options: {\n        scales: {\n            y: {\n                beginAtZero: true\n            }\n        }\n    }\n});', 'https://github.com/user/repo14', 'javascript', '2024-04-07 00:00:00.000000', 0, 0, 14),
(18, 'Java Multithreading', 'Implementing multithreading in Java for concurrent programming.', 'class MyThread extends Thread {\n    public void run() {\n        System.out.println(\"MyThread running...\");\n    }\n}\n\npublic class Main {\n    public static void main(String[] args) {\n        MyThread thread = new MyThread();\n        thread.start();\n    }\n}', 'https://github.com/user/repo15', 'java', '2024-04-06 00:00:00.000000', 0, 0, 15),
(19, 'Python GUI Application', 'Building a graphical user interface application using Python and Tkinter library.', 'import tkinter as tk\n\nroot = tk.Tk()\n\nlabel = tk.Label(root, text=\"Hello, world!\")\nlabel.pack()\n\nroot.mainloop()', 'https://github.com/user/repo16', 'python', '2024-04-05 00:00:00.000000', 0, 0, 16),
(20, 'HTML CSS Responsive Design', 'Creating a responsive web page layout using HTML and CSS.', '<!DOCTYPE html>\n<html>\n<head>\n    <title>Responsive Design</title>\n    <style>\n        @media only screen and (max-width: 600px) {\n            body {\n                background-color: lightblue;\n            }\n        }\n    </style>\n</head>\n<body>\n    <h1>Responsive Design</h1>\n</body>\n</html>', 'https://github.com/user/repo17', 'html', '2024-04-04 00:00:00.000000', 0, 0, 17),
(21, 'Java Network Programming', 'Creating network applications using Java sockets.', 'import java.io.*;\nimport java.net.*;\n\npublic class Server {\n    public static void main(String[] args) throws IOException {\n        ServerSocket serverSocket = new ServerSocket(8080);\n        Socket socket = serverSocket.accept();\n        System.out.println(\"Client connected\");\n    }\n}', 'https://github.com/user/repo18', 'java', '2024-04-03 00:00:00.000000', 0, 0, 18),
(22, 'PHP CRUD Application', 'Building a CRUD (Create, Read, Update, Delete) application using PHP and MySQL.', '<?php\n// CRUD operations\n...', 'https://github.com/user/repo19', 'PHP', '2024-04-02 00:00:00.000000', 0, 0, 19),
(23, 'SwiftUI iOS App', 'Building an iOS app using SwiftUI framework.', 'import SwiftUI\n\nstruct ContentView: View {\n    var body: some View {\n        Text(\"Hello, world!\")\n            .padding()\n    }\n}', 'https://github.com/user/repo20', 'swift', '2024-04-01 00:00:00.000000', 0, 0, 20);
