INSERT INTO `codingchallenges_codingchallenge` (`id`, `title`, `description`, `difficulty`, `created_at`, `points`, `author_id`, `solution`) VALUES
(1, 'Two Sum', 'Given an array of integers, return indices of the two numbers such that they add up to a specific target.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(2, 'Reverse Integer', 'Given a 32-bit signed integer, reverse digits of an integer.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(3, 'Merge Two Sorted Lists', 'Merge two sorted linked lists and return it as a new sorted list.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(4, 'Valid Parentheses', 'Given a string containing just the characters \'(\', \')\', \'{\', \'}\', \'[\' and \']\', determine if the input string is valid.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(5, 'Binary Tree Inorder Traversal', 'Given the root of a binary tree, return the inorder traversal of its nodes\' values.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(6, 'Add Two Numbers', 'You are given two non-empty linked lists representing two non-negative integers. The digits are stored in reverse order, and each of their nodes contains a single digit. Add the two numbers and return the sum as a linked list.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(7, 'Maximum Subarray', 'Given an integer array nums, find the contiguous subarray (containing at least one number) which has the largest sum and return its sum.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(8, 'Merge k Sorted Lists', 'Merge k sorted linked lists and return it as one sorted list.', 'Hard', '2024-04-22 00:00:00.000000', 20, 1, ''),
(9, 'Product of Array Except Self', 'Given an array nums of n integers where n > 1, return an array output such that output[i] is equal to the product of all the elements of nums except nums[i].', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(10, 'Longest Substring Without Repeating Characters', 'Given a string s, find the length of the longest substring without repeating characters.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(11, 'Container With Most Water', 'Given n non-negative integers a1, a2, ..., an , where each represents a point at coordinate (i, ai). n vertical lines are drawn such that the two endpoints of the line i is at (i, ai) and (i, 0). Find two lines, which, together with the x-axis forms a container, such that the container contains the most water.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(12, '3Sum', 'Given an array nums of n integers, are there elements a, b, c in nums such that a + b + c = 0? Find all unique triplets in the array which gives the sum of zero.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(13, 'Letter Combinations of a Phone Number', 'Given a string containing digits from 2-9 inclusive, return all possible letter combinations that the number could represent. Return the answer in any order.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(14, 'Remove Nth Node From End of List', 'Given the head of a linked list, remove the nth node from the end of the list and return its head.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(15, 'Generate Parentheses', 'Given n pairs of parentheses, write a function to generate all combinations of well-formed parentheses.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(16, 'Valid Sudoku', 'Determine if a 9 x 9 Sudoku board is valid. Only the filled cells need to be validated according to the following rules: Each row must contain the digits 1-9 without repetition. Each column must contain the digits 1-9 without repetition. Each of the nine 3 x 3 sub-boxes of the grid must contain the digits 1-9 without repetition.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(17, 'Search in Rotated Sorted Array', 'You are given an integer array nums sorted in ascending order, and an integer target. Suppose that nums is rotated at some pivot unknown to you beforehand (i.e., [0,1,2,4,5,6,7] might become [4,5,6,7,0,1,2]). If target is found in the array return its index, otherwise, return -1.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(18, 'Combination Sum', 'Given an array of distinct integers candidates and a target integer target, return a list of all unique combinations of candidates where the chosen numbers sum to target.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(19, 'Word Search', 'Given an m x n grid of characters board and a string word, return true if word exists in the grid. The word can be constructed from letters of sequentially adjacent cells, where adjacent cells are horizontally or vertically neighboring. The same letter cell may not be used more than once.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(20, 'Merge Two Sorted Lists', 'Merge two sorted linked lists and return it as a new sorted list. The new list should be made by splicing together the nodes of the first two lists.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(21, 'Reverse Integer', 'Given a signed 32-bit integer x, return x with its digits reversed. If reversing x causes the value to go outside the signed 32-bit integer range [-231, 231 - 1], then return 0.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(22, 'Roman to Integer', 'Given a roman numeral, convert it to an integer.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(23, 'Valid Parentheses', 'Given a string s containing just the characters \'(\', \')\', \'{\', \'}\', \'[\' and \']\', determine if the input string is valid.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(24, 'Longest Common Prefix', 'Write a function to find the longest common prefix string amongst an array of strings. If there is no common prefix, return an empty string \"\".', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(25, 'Palindrome Number', 'Determine whether an integer is a palindrome. An integer is a palindrome when it reads the same backward as forward.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(26, 'Merge Sorted Array', 'Given two sorted integer arrays nums1 and nums2, merge nums2 into nums1 as one sorted array.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(27, 'Maximum Subarray', 'Given an integer array nums, find the contiguous subarray (containing at least one number) which has the largest sum and return its sum.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(28, 'Two Sum', 'Given an array of integers nums and an integer target, return indices of the two numbers such that they add up to target. You may assume that each input would have exactly one solution, and you may not use the same element twice. You can return the answer in any order.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(29, 'Container With Most Water', 'Given n non-negative integers a1, a2, ..., an , where each represents a point at coordinate (i, ai). n vertical lines are drawn such that the two endpoints of the line i is at (i, ai) and (i, 0). Find two lines, which, together with the x-axis forms a container, such that the container contains the most water.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(30, '3Sum', 'Given an integer array nums, return all the triplets [nums[i], nums[j], nums[k]] such that i != j, i != k, and j != k, and nums[i] + nums[j] + nums[k] == 0. Notice that the solution set must not contain duplicate triplets.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(31, '4Sum', 'Given an array nums of n integers, return an array of all the unique quadruplets [nums[a], nums[b], nums[c], nums[d]] such that: 0 <= a, b, c, d < n, a, b, c, and d are distinct, nums[a] + nums[b] + nums[c] + nums[d] == target. You may return the answer in any order.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(32, 'Letter Combinations of a Phone Number', 'Given a string containing digits from 2-9 inclusive, return all possible letter combinations that the number could represent. Return the answer in any order.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(33, 'Remove Nth Node From End of List', 'Given the head of a linked list, remove the nth node from the end of the list and return its head.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(34, 'Generate Parentheses', 'Given n pairs of parentheses, write a function to generate all combinations of well-formed parentheses.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(35, 'Remove Duplicates from Sorted Array', 'Given an integer array nums sorted in non-decreasing order, remove the duplicates in-place such that each unique element appears only once. The relative order of the elements should be kept the same. Since it is impossible to change the length of the array in some languages, you must instead have the result be placed in the first part of the array nums. More formally, if there are k elements after removing the duplicates, then the first k elements of nums should hold the final result. It does not matter what you leave beyond the first k elements.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(36, 'Next Permutation', 'Implement next permutation, which rearranges numbers into the lexicographically next greater permutation of numbers. If such an arrangement is not possible, it must rearrange it as the lowest possible order (i.e., sorted in ascending order).', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(37, 'Group Anagrams', 'Given an array of strings strs, group the anagrams together. You can return the answer in any order.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(38, 'Longest Palindromic Substring', 'Given a string s, return the longest palindromic substring in s.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(39, 'Substring with Concatenation of All Words', 'You are given a string s and an array of strings words of the same length. Return all starting indices of substring(s) in s that is a concatenation of each word in words exactly once, in any order, and without any intervening characters.', 'Hard', '2024-04-22 00:00:00.000000', 20, 1, ''),
(40, 'Merge Two Sorted Lists', 'Merge two sorted linked lists and return it as a sorted list. The list should be made by splicing together the nodes of the first two lists.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(41, 'Valid Parentheses', 'Given a string s containing just the characters `(`, `)`, `{`, `}`, `[`, and `]`, determine if the input string is valid.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(42, 'Reverse Integer', 'Given a signed 32-bit integer `x`, return `x` with its digits reversed. If reversing `x` causes the value to go outside the signed 32-bit integer range `[-2^31, 2^31 - 1]`, then return 0.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(43, 'Palindrome Number', 'Given an integer `x`, return `true` if `x` is palindrome integer. An integer is a palindrome when it reads the same backward as forward. For example, 121 is palindrome while 123 is not.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(44, 'Roman to Integer', 'Given a roman numeral, convert it to an integer. Input is guaranteed to be within the range from 1 to 3999.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(45, 'Container With Most Water', 'Given n non-negative integers a1, a2, ..., an , where each represents a point at coordinate (i, ai). n vertical lines are drawn such that the two endpoints of the line i is at (i, ai) and (i, 0). Find two lines, which, together with the x-axis forms a container, such that the container contains the most water.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(46, '3Sum', 'Given an array nums of n integers, are there elements a, b, c in nums such that a + b + c = 0? Find all unique triplets in the array which gives the sum of zero.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(47, 'Longest Substring Without Repeating Characters', 'Given a string s, find the length of the longest substring without repeating characters.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(48, 'Palindrome Linked List', 'Given a singly linked list, determine if it is a palindrome.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(49, 'Two Sum', 'Given an array of integers nums and an integer target, return indices of the two numbers such that they add up to target.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(50, 'Spiral Matrix', 'Given an m x n matrix, return all elements of the matrix in spiral order.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(51, 'Subsets', 'Given an integer array nums of unique elements, return all possible subsets (the power set). The solution set must not contain duplicate subsets.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(52, 'Word Search', 'Given an m x n grid of characters board and a string word, return true if word exists in the grid. The word can be constructed from letters of sequentially adjacent cells, where adjacent cells are horizontally or vertically neighboring. The same letter cell may not be used more than once.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(53, 'Merge k Sorted Lists', 'You are given an array of k linked-lists lists, each linked-list is sorted in ascending order. Merge all the linked-lists into one sorted linked-list and return it.', 'Hard', '2024-04-22 00:00:00.000000', 20, 1, ''),
(54, 'ZigZag Conversion', 'The string \"PAYPALISHIRING\" is written in a zigzag pattern on a given number of rows like this: (you may want to display this pattern in a fixed font for better legibility) P   A   H   N\nA P L S I I G\nY   I   R And then read line by line: \"PAHNAPLSIIGYIR\" Write the code that will take a string and make this conversion given a number of rows.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(55, 'Remove Nth Node From End of List', 'Given the head of a linked list, remove the nth node from the end of the list and return its head.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(56, 'Letter Combinations of a Phone Number', 'Given a string containing digits from 2-9 inclusive, return all possible letter combinations that the number could represent. Return the answer in any order. A mapping of digit to letters (just like on the telephone buttons) is given below. Note that 1 does not map to any letters.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(57, 'Remove Duplicates from Sorted Array', 'Given a sorted array nums, remove the duplicates in-place such that each element appears only once and returns the new length. Do not allocate extra space for another array, you must do this by modifying the input array in-place with O(1) extra memory.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(58, 'Generate Parentheses', 'Given n pairs of parentheses, write a function to generate all combinations of well-formed parentheses.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(59, 'Rotate Image', 'You are given an n x n 2D matrix representing an image, rotate the image by 90 degrees (clockwise). You have to rotate the image in-place, which means you have to modify the input 2D matrix directly. DO NOT allocate another 2D matrix and do the rotation.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(60, 'Group Anagrams', 'Given an array of strings strs, group the anagrams together. You can return the answer in any order.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(61, 'Maximum Subarray', 'Given an integer array nums, find the contiguous subarray (containing at least one number) which has the largest sum and return its sum.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(62, 'Jump Game', 'Given an array of non-negative integers nums, you are initially positioned at the first index of the array. Each element in the array represents your maximum jump length at that position. Determine if you can reach the last index.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(63, 'Search in Rotated Sorted Array', 'You are given an integer array nums sorted in ascending order, and an integer target. Suppose that nums is rotated at some pivot unknown to you beforehand (i.e., [0,1,2,4,5,6,7] might become [4,5,6,7,0,1,2]). If target is found in the array return its index, otherwise, return -1.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(64, 'Pow(x, n)', 'Implement pow(x, n), which calculates x raised to the power n (i.e., xn).', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(65, 'Median of Two Sorted Arrays', 'Given two sorted arrays nums1 and nums2 of size m and n respectively, return the median of the two sorted arrays.', 'Hard', '2024-04-22 00:00:00.000000', 20, 1, ''),
(66, 'Longest Palindromic Substring', 'Given a string s, return the longest palindromic substring in s.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(67, 'Best Time to Buy and Sell Stock', 'You are given an array prices where prices[i] is the price of a given stock on the ith day. You want to maximize your profit by choosing a single day to buy one stock and choosing a different day in the future to sell that stock. Return the maximum profit you can achieve from this transaction. If you cannot achieve any profit, return 0.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(68, 'Longest Common Subsequence', 'Given two strings text1 and text2, return the length of their longest common subsequence. If there is no common subsequence, return 0.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(69, 'House Robber', 'You are a professional robber planning to rob houses along a street. Each house has a certain amount of money stashed, the only constraint stopping you from robbing each of them is that adjacent houses have security systems connected and it will automatically contact the police if two adjacent houses were broken into on the same night. Given an integer array nums representing the amount of money of each house, return the maximum amount of money you can rob tonight without alerting the police.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(70, 'Kth Largest Element in an Array', 'Find the kth largest element in an unsorted array. Note that it is the kth largest element in the sorted order, not the kth distinct element.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(71, 'Search Insert Position', 'Given a sorted array of distinct integers and a target value, return the index if the target is found. If not, return the index where it would be if it were inserted in order.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(72, 'Maximum Product Subarray', 'Given an integer array nums, find the contiguous subarray within an array (containing at least one number) which has the largest product.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(73, 'Coin Change', 'You are given an integer array coins representing coins of different denominations and an integer amount representing a total amount of money. Return the fewest number of coins that you need to make up that amount. If that amount of money cannot be made up by any combination of the coins, return -1. You may assume that you have an infinite number of each kind of coin.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(74, 'Integer to Roman', 'Given an integer, convert it to a roman numeral. Input is guaranteed to be within the range from 1 to 3999.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(75, 'House Robber II', 'You are a professional robber planning to rob houses along a street. Each house has a certain amount of money stashed. All houses at this place are arranged in a circle. That means the first house is the neighbor of the last one. Meanwhile, adjacent houses have a security system connected, and it will automatically contact the police if two adjacent houses were broken into on the same night. Given an integer array nums representing the amount of money of each house, return the maximum amount of money you can rob tonight without alerting the police.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(76, 'String to Integer (atoi)', 'Implement the `myAtoi(string s)` function, which converts a string to a 32-bit signed integer (similar to C/C++\'s `atoi` function).', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(77, '3Sum', 'Given an integer array nums, return all the triplets `[nums[i], nums[j], nums[k]]` such that `i != j`, `i != k`, and `j != k`, and `nums[i] + nums[j] + nums[k] == 0`. Notice that the solution set must not contain duplicate triplets.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(78, 'Letter Combinations of a Phone Number', 'Given a string containing digits from 2-9 inclusive, return all possible letter combinations that the number could represent. Return the answer in any order.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(79, 'Unique Paths', 'A robot is located at the top-left corner of a m x n grid (marked \'Start\' in the diagram below). The robot can only move either down or right at any point in time. The robot is trying to reach the bottom-right corner of the grid (marked \'Finish\' in the diagram below). How many possible unique paths are there?', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(80, '4Sum', 'Given an array nums of n integers, return an array of all the unique quadruplets [nums[a], nums[b], nums[c], nums[d]] such that: 0 <= a, b, c, d < n and a, b, c, and d are distinct.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(81, 'Search in Rotated Sorted Array', 'You are given an integer array nums sorted in ascending order (with distinct values), and an integer target. Suppose that nums is rotated at some pivot unknown to you beforehand (i.e., [0,1,2,4,5,6,7] might become [4,5,6,7,0,1,2]). If target is found in the array return its index, otherwise, return -1.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(82, 'Combination Sum', 'Given an array of distinct integers candidates and a target integer target, return a list of all unique combinations of candidates where the chosen numbers sum to target. You may return the combinations in any order. The same number may be chosen from candidates an unlimited number of times. Two combinations are unique if the frequency of at least one of the chosen numbers is different.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(83, 'Search a 2D Matrix', 'Write an efficient algorithm that searches for a value in an m x n matrix. This matrix has the following properties: Integers in each row are sorted from left to right. The first integer of each row is greater than the last integer of the previous row.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(84, 'Longest Common Prefix', 'Write a function to find the longest common prefix string amongst an array of strings. If there is no common prefix, return an empty string \"\".', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(85, 'Valid Sudoku', 'Determine if a 9 x 9 Sudoku board is valid. Only the filled cells need to be validated according to the following rules: Each row must contain the digits 1-9 without repetition. Each column must contain the digits 1-9 without repetition. Each of the nine 3 x 3 sub-boxes of the grid must contain the digits 1-9 without repetition.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(86, 'Count and Say', 'The count-and-say sequence is a sequence of digit strings defined by the recursive formula: countAndSay(1) = \"1\" countAndSay(n) is the way you would \"say\" the digit string from countAndSay(n-1), which is then converted into a different digit string. To determine how you \"say\" a digit string, split it into the minimal number of groups so that each group is a contiguous section all of the same character. Then for each group, say the number of characters, then say the character. To convert the saying into a digit string, replace the counts with a number and concatenate every saying.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(87, 'Maximum Subarray', 'Given an integer array nums, find the contiguous subarray (containing at least one number) which has the largest sum and return its sum.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(88, 'Group Anagrams', 'Given an array of strings strs, group the anagrams together. You can return the answer in any order. An Anagram is a word or phrase formed by rearranging the letters of a different word or phrase, typically using all the original letters exactly once.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(89, 'Longest Palindromic Substring', 'Given a string s, return the longest palindromic substring in s.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(90, 'String to Integer (atoi)', 'Implement the myAtoi(string s) function, which converts a string to a 32-bit signed integer (similar to C/C++\'s atoi function).', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(91, 'Merge Intervals', 'Given an array of intervals where intervals[i] = [start_i, end_i], merge all overlapping intervals, and return an array of the non-overlapping intervals that cover all the intervals in the input.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(92, 'Implement strStr()', 'Implement strStr(). Return the index of the first occurrence of needle in haystack, or -1 if needle is not part of haystack.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, ''),
(93, 'Permutations', 'Given an array nums of distinct integers, return all the possible permutations. You can return the answer in any order.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(94, 'Generate Parentheses', 'Given n pairs of parentheses, write a function to generate all combinations of well-formed parentheses.', 'Medium', '2024-04-22 00:00:00.000000', 10, 1, ''),
(95, 'Merge Two Sorted Lists', 'Merge two sorted linked lists and return it as a sorted list. The list should be made by splicing together the nodes of the first two lists.', 'Easy', '2024-04-22 00:00:00.000000', 5, 1, '');
