INSERT INTO `codingchallenges_solution` (`id`, `allsolution`, `submitted_at`, `likes`, `dislikes`, `user_id`, `language`) VALUES
(1, 'def two_sum(nums, target):\n    # Dictionary to store the complement of each element\n    complements = {}\n    for i, num in enumerate(nums):\n        complement = target - num\n        if complement in complements:\n            return [complements[complement], i]\n        complements[num] = i\n\n# Example usage\nnums = [2, 7, 11, 15]\ntarget = 9\nprint(two_sum(nums, target))', '2024-04-22 00:00:00.000000', 5, 1, 1, 'Python'),
(2, '// Java solution for Two Sum\npublic int[] twoSum(int[] nums, int target) {\n    Map<Integer, Integer> map = new HashMap<>();\n    for (int i = 0; i < nums.length; i++) {\n        int complement = target - nums[i];\n        if (map.containsKey(complement)) {\n            return new int[] { map.get(complement), i };\n        }\n        map.put(nums[i], i);\n    }\n    throw new IllegalArgumentException(\"No two sum solution\");\n}\n\n// Example usage\nint[] nums = {2, 7, 11, 15};\nint target = 9;\nint[] result = twoSum(nums, target);\nSystem.out.println(Arrays.toString(result));', '2024-04-22 00:00:00.000000', 5, 1, 1, 'Java'),
(3, 'def reverse_integer(x):\n    sign = -1 if x < 0 else 1\n    x = abs(x)\n    reverse = 0\n    while x != 0:\n        reverse = reverse * 10 + x % 10\n        x //= 10\n    return sign * reverse\n\n# Example usage\nx = 123\nprint(reverse_integer(x))', '2024-04-22 00:00:00.000000', 5, 1, 1, 'Python'),
(4, '// Java solution for Reverse Integer\npublic int reverse(int x) {\n    long reversed = 0;\n    while (x != 0) {\n        reversed = reversed * 10 + x % 10;\n        x /= 10;\n    }\n    if (reversed < Integer.MIN_VALUE || reversed > Integer.MAX_VALUE) {\n        return 0;\n    }\n    return (int)reversed;\n}\n\n// Example usage\nint x = 123;\nSystem.out.println(reverse(x));', '2024-04-22 00:00:00.000000', 5, 1, 1, 'Java'),
(5, '// JavaScript solution for Reverse Integer\nfunction reverseInteger(x) {\n    let reversed = 0;\n    const sign = Math.sign(x);\n    x = Math.abs(x);\n    while (x !== 0) {\n        reversed = reversed * 10 + x % 10;\n        x = Math.floor(x / 10);\n    }\n    return sign * reversed;\n}\n\n// Example usage\nconst x = 123;\nconsole.log(reverseInteger(x));', '2024-04-22 00:00:00.000000', 5, 1, 1, 'JavaScript'),
(6, '// C++ solution for Merge Two Sorted Lists\nListNode* mergeTwoLists(ListNode* l1, ListNode* l2) {\n    if (!l1) return l2;\n    if (!l2) return l1;\n    if (l1->val < l2->val) {\n        l1->next = mergeTwoLists(l1->next, l2);\n        return l1;\n    } else {\n        l2->next = mergeTwoLists(l1, l2->next);\n        return l2;\n    }\n}\n\n// Example usage\n// Assume ListNode class is defined elsewhere\nListNode* l1 = /* create l1 */;\nListNode* l2 = /* create l2 */;\nListNode* mergedList = mergeTwoLists(l1, l2);', '2024-04-22 00:00:00.000000', 5, 1, 1, 'C++'),
(7, '# Python solution for Merge Two Sorted Lists\ndef mergeTwoLists(l1, l2):\n    if not l1:\n        return l2\n    if not l2:\n        return l1\n    if l1.val < l2.val:\n        l1.next = mergeTwoLists(l1.next, l2)\n        return l1\n    else:\n        l2.next = mergeTwoLists(l1, l2.next)\n        return l2\n\n# Example usage\n# Assume ListNode class is defined elsewhere\nl1 = /* create l1 */\nl2 = /* create l2 */\nmerged_list = mergeTwoLists(l1, l2)', '2024-04-22 00:00:00.000000', 5, 1, 1, 'Python'),
(8, '// Java solution for Merge Two Sorted Lists\npublic ListNode mergeTwoLists(ListNode l1, ListNode l2) {\n    if (l1 == null) return l2;\n    if (l2 == null) return l1;\n    if (l1.val < l2.val) {\n        l1.next = mergeTwoLists(l1.next, l2);\n        return l1;\n    } else {\n        l2.next = mergeTwoLists(l1, l2.next);\n        return l2;\n    }\n}\n\n// Example usage\n// Assume ListNode class is defined elsewhere\nListNode l1 = /* create l1 */;\nListNode l2 = /* create l2 */;\nListNode mergedList = mergeTwoLists(l1, l2);', '2024-04-22 00:00:00.000000', 5, 1, 1, 'Java'),
(9, '# Python solution for Valid Parentheses\ndef isValid(s: str) -> bool:\n    stack = []\n    mapping = {\")\": \"(\", \"}\": \"{\", \"]\": \"[\"}\n    for char in s:\n        if char in mapping:\n            top_element = stack.pop() if stack else \'#\'\n            if mapping[char] != top_element:\n                return False\n        else:\n            stack.append(char)\n    return not stack\n\n# Example usage\ns = \"((()))\"\nprint(isValid(s))', '2024-04-22 00:00:00.000000', 5, 1, 1, 'Python'),
(10, '// Java solution for Valid Parentheses\nimport java.util.Stack;\npublic boolean isValid(String s) {\n    Stack<Character> stack = new Stack<>();\n    for (char c : s.toCharArray()) {\n        if (c == \'(\') stack.push(\')\');\n        else if (c == \'{\') stack.push(\'}\');\n        else if (c == \'[\') stack.push(\']\');\n        else if (stack.isEmpty() || stack.pop() != c) return false;\n    }\n    return stack.isEmpty();\n}\n\n// Example usage\nString s = \"((()))\";\nSystem.out.println(isValid(s));', '2024-04-22 00:00:00.000000', 5, 1, 1, 'Java'),
(11, '// JavaScript solution for Valid Parentheses\nvar isValid = function(s) {\n    let stack = [];\n    let map = {\n        \")\": \"(\",\n        \"}\": \"{\",\n        \"]\": \"[\"\n    };\n    for (let i = 0; i < s.length; i++) {\n        if (s[i] in map) {\n            let topElement = stack.length === 0 ? \"#\" : stack.pop();\n            if (map[s[i]] !== topElement) {\n                return false;\n            }\n        } else {\n            stack.push(s[i]);\n        }\n    }\n    return stack.length === 0;\n};\n\n// Example usage\nlet s = \"((()))\";\nconsole.log(isValid(s));', '2024-04-22 00:00:00.000000', 5, 1, 1, 'JavaScript'),
(12, '# Python solution for Binary Tree Inorder Traversal\nclass Solution:\n    def inorderTraversal(self, root: TreeNode) -> List[int]:\n        result = []\n        self.inorder_helper(root, result)\n        return result\n\n    def inorder_helper(self, root, result):\n        if root is None:\n            return\n        self.inorder_helper(root.left, result)\n        result.append(root.val)\n        self.inorder_helper(root.right, result)\n\n# Example usage\n# Assume TreeNode class is defined elsewhere\nsolution = Solution()\nroot = /* create binary tree */\nprint(solution.inorderTraversal(root))', '2024-04-22 00:00:00.000000', 10, 1, 1, 'Python'),
(13, '// Java solution for Binary Tree Inorder Traversal\nimport java.util.List;\nimport java.util.ArrayList;\npublic class Solution {\n    public List<Integer> inorderTraversal(TreeNode root) {\n        List<Integer> result = new ArrayList<>();\n        inorderHelper(root, result);\n        return result;\n    }\n    private void inorderHelper(TreeNode root, List<Integer> result) {\n        if (root == null) {\n            return;\n        }\n        inorderHelper(root.left, result);\n        result.add(root.val);\n        inorderHelper(root.right, result);\n    }\n}\n\n// Example usage\n// Assume TreeNode class is defined elsewhere\nSolution solution = new Solution();\nTreeNode root = /* create binary tree */;\nSystem.out.println(solution.inorderTraversal(root));', '2024-04-22 00:00:00.000000', 10, 1, 1, 'Java'),
(14, '// C++ solution for Binary Tree Inorder Traversal\nclass Solution {\npublic:\n    vector<int> inorderTraversal(TreeNode* root) {\n        vector<int> result;\n        inorderHelper(root, result);\n        return result;\n    }\n    void inorderHelper(TreeNode* root, vector<int>& result) {\n        if (root == nullptr) {\n            return;\n        }\n        inorderHelper(root->left, result);\n        result.push_back(root->val);\n        inorderHelper(root->right, result);\n    }\n};\n\n// Example usage\n// Assume TreeNode class is defined elsewhere\nSolution solution;\nTreeNode* root = /* create binary tree */;\nvector<int> result = solution.inorderTraversal(root);', '2024-04-22 00:00:00.000000', 10, 1, 1, 'C++'),
(15, '# Python solution for Add Two Numbers\nclass Solution:\n    def addTwoNumbers(self, l1: ListNode, l2: ListNode) -> ListNode:\n        dummy = ListNode(0)\n        current = dummy\n        carry = 0\n        while l1 or l2 or carry:\n            sum = carry\n            if l1:\n                sum += l1.val\n                l1 = l1.next\n            if l2:\n                sum += l2.val\n                l2 = l2.next\n            carry, val = divmod(sum, 10)\n            current.next = ListNode(val)\n            current = current.next\n        return dummy.next\n\n# Example usage\n# Assume ListNode class is defined elsewhere\nsolution = Solution()\nl1 = /* create linked list */\nl2 = /* create linked list */\nresult = solution.addTwoNumbers(l1, l2)\nwhile result:\n    print(result.val)\n    result = result.next', '2024-04-22 00:00:00.000000', 10, 1, 1, 'Python'),
(16, '// Java solution for Add Two Numbers\npublic class Solution {\n    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {\n        ListNode dummy = new ListNode(0);\n        ListNode current = dummy;\n        int carry = 0;\n        while (l1 != null || l2 != null || carry != 0) {\n            int sum = carry;\n            if (l1 != null) {\n                sum += l1.val;\n                l1 = l1.next;\n            }\n            if (l2 != null) {\n                sum += l2.val;\n                l2 = l2.next;\n            }\n            carry = sum / 10;\n            current.next = new ListNode(sum % 10);\n            current = current.next;\n        }\n        return dummy.next;\n    }\n}\n\n// Example usage\n// Assume ListNode class is defined elsewhere\nSolution solution = new Solution();\nListNode l1 = /* create linked list */;\nListNode l2 = /* create linked list */;\nListNode result = solution.addTwoNumbers(l1, l2);\nwhile (result != null) {\n    System.out.print(result.val + \" \");\n    result = result.next;\n}', '2024-04-22 00:00:00.000000', 10, 1, 1, 'Java'),
(17, '// JavaScript solution for Add Two Numbers\nvar addTwoNumbers = function(l1, l2) {\n    let dummy = new ListNode(0);\n    let current = dummy;\n    let carry = 0;\n    while (l1 || l2 || carry) {\n        let sum = carry;\n        if (l1) {\n            sum += l1.val;\n            l1 = l1.next;\n        }\n        if (l2) {\n            sum += l2.val;\n            l2 = l2.next;\n        }\n        carry = Math.floor(sum / 10);\n        current.next = new ListNode(sum % 10);\n        current = current.next;\n    }\n    return dummy.next;\n};\n\n// Example usage\n// Assume ListNode class is defined elsewhere\nlet l1 = /* create linked list */;\nlet l2 = /* create linked list */;\nlet result = addTwoNumbers(l1, l2);\nwhile (result) {\n    console.log(result.val);\n    result = result.next;\n}', '2024-04-22 00:00:00.000000', 10, 1, 1, 'JavaScript'),
(18, '# Python solution for Maximum Subarray\nfrom typing import List\n\ndef maxSubArray(nums: List[int]) -> int:\n    if not nums:\n        return 0\n    max_sum = current_sum = nums[0]\n    for num in nums[1:]:\n        current_sum = max(num, current_sum + num)\n        max_sum = max(max_sum, current_sum)\n    return max_sum\n\n# Example usage\nnums = /* provide integer array */\nprint(maxSubArray(nums))', '2024-04-22 00:00:00.000000', 5, 1, 1, 'Python'),
(19, '// Java solution for Maximum Subarray\npublic class Solution {\n    public int maxSubArray(int[] nums) {\n        if (nums == null || nums.length == 0) {\n            return 0;\n        }\n        int maxSum = nums[0];\n        int currentSum = nums[0];\n        for (int i = 1; i < nums.length; i++) {\n            currentSum = Math.max(nums[i], currentSum + nums[i]);\n            maxSum = Math.max(maxSum, currentSum);\n        }\n        return maxSum;\n    }\n}\n\n// Example usage\n// int[] nums = /* provide integer array */;\n// Solution solution = new Solution();\n// System.out.println(solution.maxSubArray(nums));', '2024-04-22 00:00:00.000000', 5, 1, 1, 'Java'),
(20, '// C++ solution for Maximum Subarray\n#include <vector>\n#include <algorithm>\nusing namespace std;\n\nclass Solution {\npublic:\n    int maxSubArray(vector<int>& nums) {\n        if (nums.empty()) {\n            return 0;\n        }\n        int maxSum = nums[0];\n        int currentSum = nums[0];\n        for (int i = 1; i < nums.size(); i++) {\n            currentSum = max(nums[i], currentSum + nums[i]);\n            maxSum = max(maxSum, currentSum);\n        }\n        return maxSum;\n    }\n};\n\n// Example usage\n// vector<int> nums = /* provide integer array */;\n// Solution solution;\n// cout << solution.maxSubArray(nums);', '2024-04-22 00:00:00.000000', 5, 1, 1, 'C++'),
(21, '# Python solution for Merge k Sorted Lists\nfrom queue import PriorityQueue\nfrom typing import List\n\nclass ListNode:\n    def __init__(self, val=0, next=None):\n        self.val = val\n        self.next = next\n\ndef mergeKLists(lists: List[ListNode]) -> ListNode:\n    dummy = ListNode()\n    current = dummy\n    q = PriorityQueue()\n    for head in lists:\n        if head:\n            q.put((head.val, head))\n    while not q.empty():\n        val, node = q.get()\n        current.next = node\n        current = current.next\n        if node.next:\n            q.put((node.next.val, node.next))\n    return dummy.next\n\n# Example usage\n# Assume ListNode class is defined elsewhere\nlists = /* provide list of linked lists */\nresult = mergeKLists(lists)', '2024-04-22 00:00:00.000000', 20, 1, 1, 'Python'),
(22, '// Java solution for Merge k Sorted Lists\nimport java.util.PriorityQueue;\n\nclass ListNode {\n    int val;\n    ListNode next;\n    ListNode(int x) { val = x; }\n}\n\nclass Solution {\n    public ListNode mergeKLists(ListNode[] lists) {\n        ListNode dummy = new ListNode(0);\n        ListNode current = dummy;\n        PriorityQueue<ListNode> q = new PriorityQueue<>((a, b) -> a.val - b.val);\n        for (ListNode head : lists) {\n            if (head != null) {\n                q.offer(head);\n            }\n        }\n        while (!q.isEmpty()) {\n            ListNode node = q.poll();\n            current.next = node;\n            current = current.next;\n            if (node.next != null) {\n                q.offer(node.next);\n            }\n        }\n        return dummy.next;\n    }\n}\n\n// Example usage\n// ListNode[] lists = /* provide array of linked lists */;\n// Solution solution = new Solution();\n// ListNode result = solution.mergeKLists(lists);', '2024-04-22 00:00:00.000000', 20, 1, 1, 'Java'),
(23, '// C++ solution for Merge k Sorted Lists\n#include <vector>\n#include <queue>\nusing namespace std;\n\nclass ListNode {\npublic:\n    int val;\n    ListNode *next;\n    ListNode(int x) : val(x), next(NULL) {}\n};\n\nclass Solution {\npublic:\n    struct CompareNode {\n        bool operator()(ListNode* a, ListNode* b) {\n            return a->val > b->val;\n        }\n    };\n    ListNode* mergeKLists(vector<ListNode*>& lists) {\n        priority_queue<ListNode*, vector<ListNode*>, CompareNode> pq;\n        for (ListNode* head : lists) {\n            if (head) pq.push(head);\n        }\n        ListNode dummy(0);\n        ListNode* tail = &dummy;\n        while (!pq.empty()) {\n            tail->next = pq.top();\n            pq.pop();\n            tail = tail->next;\n            if (tail->next) pq.push(tail->next);\n        }\n        return dummy.next;\n    }\n};\n\n// Example usage\n// vector<ListNode*> lists = /* provide vector of linked lists */;\n// Solution solution;\n// ListNode* result = solution.mergeKLists(lists);', '2024-04-22 00:00:00.000000', 20, 1, 1, 'C++'),
(24, '# Python solution for Product of Array Except Self\nfrom typing import List\n\ndef productExceptSelf(nums: List[int]) -> List[int]:\n    n = len(nums)\n    output = [1] * n\n    left_product, right_product = 1, 1\n    for i in range(n):\n        output[i] *= left_product\n        left_product *= nums[i]\n    for i in range(n - 1, -1, -1):\n        output[i] *= right_product\n        right_product *= nums[i]\n    return output\n\n# Example usage\nnums = /* provide integer array */\nprint(productExceptSelf(nums))', '2024-04-22 00:00:00.000000', 10, 1, 1, 'Python'),
(25, '// Java solution for Product of Array Except Self\npublic class Solution {\n    public int[] productExceptSelf(int[] nums) {\n        int n = nums.length;\n        int[] output = new int[n];\n        int leftProduct = 1;\n        int rightProduct = 1;\n        for (int i = 0; i < n; i++) {\n            output[i] = leftProduct;\n            leftProduct *= nums[i];\n        }\n        for (int i = n - 1; i >= 0; i--) {\n            output[i] *= rightProduct;\n            rightProduct *= nums[i];\n        }\n        return output;\n    }\n}\n\n// Example usage\n// int[] nums = /* provide integer array */;\n// Solution solution = new Solution();\n// int[] result = solution.productExceptSelf(nums);', '2024-04-22 00:00:00.000000', 10, 1, 1, 'Java'),
(26, '// C++ solution for Product of Array Except Self\n#include <vector>\nusing namespace std;\n\nclass Solution {\npublic:\n    vector<int> productExceptSelf(vector<int>& nums) {\n        int n = nums.size();\n        vector<int> output(n, 1);\n        int leftProduct = 1;\n        int rightProduct = 1;\n        for (int i = 0; i < n; i++) {\n            output[i] *= leftProduct;\n            leftProduct *= nums[i];\n        }\n        for (int i = n - 1; i >= 0; i--) {\n            output[i] *= rightProduct;\n            rightProduct *= nums[i];\n        }\n        return output;\n    }\n};\n\n// Example usage\n// vector<int> nums = /* provide integer array */;\n// Solution solution;\n// vector<int> result = solution.productExceptSelf(nums);', '2024-04-22 00:00:00.000000', 10, 1, 1, 'C++'),
(27, '# Python solution for Longest Substring Without Repeating Characters\n\ndef lengthOfLongestSubstring(s: str) -> int:\n    n = len(s)\n    max_len = 0\n    start = 0\n    char_index = {}\n    for end in range(n):\n        if s[end] in char_index and char_index[s[end]] >= start:\n            start = char_index[s[end]] + 1\n        char_index[s[end]] = end\n        max_len = max(max_len, end - start + 1)\n    return max_len\n\n# Example usage\ns = /* provide string */\nprint(lengthOfLongestSubstring(s))', '2024-04-22 00:00:00.000000', 10, 1, 1, 'Python'),
(28, '// Java solution for Longest Substring Without Repeating Characters\npublic class Solution {\n    public int lengthOfLongestSubstring(String s) {\n        int n = s.length();\n        int maxLen = 0;\n        int start = 0;\n        Map<Character, Integer> charIndex = new HashMap<>();\n        for (int end = 0; end < n; end++) {\n            if (charIndex.containsKey(s.charAt(end)) && charIndex.get(s.charAt(end)) >= start) {\n                start = charIndex.get(s.charAt(end)) + 1;\n            }\n            charIndex.put(s.charAt(end), end);\n            maxLen = Math.max(maxLen, end - start + 1);\n        }\n        return maxLen;\n    }\n}\n\n// Example usage\n// String s = /* provide string */;\n// Solution solution = new Solution();\n// System.out.println(solution.lengthOfLongestSubstring(s));', '2024-04-22 00:00:00.000000', 10, 1, 1, 'Java'),
(29, '// C++ solution for Longest Substring Without Repeating Characters\n#include <string>\n#include <unordered_map>\nusing namespace std;\n\nclass Solution {\npublic:\n    int lengthOfLongestSubstring(string s) {\n        int n = s.length();\n        int maxLen = 0;\n        int start = 0;\n        unordered_map<char, int> charIndex;\n        for (int end = 0; end < n; end++) {\n            if (charIndex.find(s[end]) != charIndex.end() && charIndex[s[end]] >= start) {\n                start = charIndex[s[end]] + 1;\n            }\n            charIndex[s[end]] = end;\n            maxLen = max(maxLen, end - start + 1);\n        }\n        return maxLen;\n    }\n};\n\n// Example usage\n// string s = /* provide string */;\n// Solution solution;\n// cout << solution.lengthOfLongestSubstring(s) << endl;', '2024-04-22 00:00:00.000000', 10, 1, 1, 'C++');
