(44, 'Travel Expense Tracker', 'An app for tracking travel expenses and managing budgets while on the go. It allows users to categorize expenses, attach receipts, and generate expense reports.', 'https://github.com/user/travel-expense-tracker'),
(45, 'Recipe Search Engine', 'A search engine for finding recipes from various sources across the web. Users can search by ingredients, dietary preferences, and cuisine types to discover new recipes.', 'https://github.com/user/recipe-search-engine'),
