(64, 'IoT-enabled Energy Management System: EnergySense', 'EnergySense is an IoT-enabled energy management system development project aimed at optimizing energy consumption and efficiency in buildings and facilities. With IoT sensors and smart controls, EnergySense monitors energy usage, identifies inefficiencies, and implements energy-saving measures for cost reduction and sustainability.', '2023-05-05', '2023-11-05', 1, 11),
(65, 'Deep Learning Natural Language Generation: NLGen', 'NLGen is a deep learning project focused on natural language generation (NLG) tasks such as text summarization, content generation, and language translation. Using deep neural networks and language models, NLGen generates human-like text outputs for various applications.', '2023-03-01', '2023-09-01', 1, 11),
(66, 'AI-driven Personal Finance Assistant: FinAssist', 'FinAssist is an AI-driven personal finance assistant that helps users manage budgets, track expenses, and achieve financial goals. Using machine learning algorithms and financial data analysis, FinAssist provides personalized financial insights and recommendations to improve financial well-being.', '2023-06-08', '2023-12-08', 1, 11),
