(68, 'AI-driven Personalized News Aggregator: NewsAI', 'NewsAI is an AI-driven personalized news aggregator that curates news articles and updates based on user interests and preferences. Using natural language processing (NLP) and content analysis, NewsAI delivers relevant and timely news content to users across platforms.', '2023-03-20', '2023-09-20', 1, 12),
(69, 'Blockchain-based Intellectual Property Platform: IPChain', 'IPChain is a blockchain-based intellectual property platform that provides secure and immutable records for patents, trademarks, and copyrights. Leveraging blockchain technology, IPChain ensures protection and traceability of intellectual property rights for creators and innovators.', '2023-02-15', '2023-08-15', 1, 12),
(70, 'IoT-enabled Smart Transportation System: TransSense', 'TransSense is an IoT-enabled smart transportation system development project focused on improving traffic flow, public transit efficiency, and road safety. With IoT sensors, traffic monitoring, and predictive analytics, TransSense optimizes transportation infrastructure and enhances mobility for urban communities.', '2023-04-25', '2023-10-25', 1, 12),
