INSERT INTO `projectrecommendations_project` (`id`, `title`, `description`, `github_link`, `image`, `difficulty`, `domain`, `created_at`, `likes`, `dislikes`, `rating`, `user_id`) VALUES
(1, 'Blog Platform', 'A blogging platform allowing users to create, edit, and publish articles. Built using Django for the backend and React for the frontend.', 'https://github.com/yourusername/blog-platform', 'project1.jpg', 'Intermediate', 'Content Management', '2023-12-27 18:58:14.000000', 276, 440, 5, 26),
(2, 'Recipe Sharing App', 'An app where users can share and discover recipes. Includes features for creating profiles, saving favorite recipes, and commenting on recipes. Developed with Angular and Firebase.', 'https://github.com/yourusername/recipe-sharing-app', 'project2.jpg', 'Intermediate', 'Food & Cooking', '2024-01-15 18:58:14.000000', 74, 393, 4, 48),
(3, 'Online Learning Platform', 'An online platform for courses and tutorials. Users can enroll in courses, track progress, and receive certificates upon completion. Built using Flask, React, and MySQL.', 'https://github.com/yourusername/online-learning-platform', 'project3.jpg', 'Advanced', 'Education', '2023-12-02 18:58:14.000000', 409, 113, 2, 9),
(4, 'Travel Planner', 'A web application for planning trips and itineraries. Users can search for destinations, book accommodations, and create personalized travel plans. Developed using Vue.js, Express.js, and MongoDB.', 'https://github.com/yourusername/travel-planner', 'project4.jpg', 'Intermediate', 'Travel & Tourism', '2024-03-04 18:58:14.000000', 449, 464, 5, 48),
(5, 'Inventory Management System', 'A system for managing inventory and stock levels for businesses. Features include barcode scanning, order tracking, and reporting. Developed using ASP.NET Core and Angular.', 'https://github.com/yourusername/inventory-management-system', 'project5.jpg', 'Advanced', 'Business & Finance', '2023-10-20 18:58:14.000000', 470, 414, 2, 41),
(6, 'Fitness Tracker', 'A fitness tracking app for recording workouts, setting fitness goals, and tracking progress over time. Built with React Native and Firebase.', 'https://github.com/yourusername/fitness-tracker', 'project6.jpg', 'Beginner', 'Health & Fitness', '2024-03-03 18:58:14.000000', 183, 74, 2, 38),
(7, 'Real Estate Listings', 'A web application for browsing and searching real estate listings. Users can filter listings based on various criteria and contact agents for more information. Developed with Django and React.', 'https://github.com/yourusername/real-estate-listings', 'project7.jpg', 'Intermediate', 'Real Estate', '2024-02-23 18:58:14.000000', 327, 417, 2, 36),
(8, 'Online Marketplace', 'An online marketplace for buying and selling goods. Includes features for user authentication, product listings, and secure transactions. Built using Ruby on Rails and Vue.js.', 'https://github.com/yourusername/online-marketplace', 'project8.jpg', 'Intermediate', 'E-commerce', '2023-11-29 18:58:14.000000', 446, 161, 4, 14),
(9, 'Event Management System', 'A platform for organizing and managing events. Users can create events, sell tickets, and track attendee registrations. Developed with Laravel and Vue.js.', 'https://github.com/yourusername/event-management-system', 'project9.jpg', 'Advanced', 'Event Planning', '2023-10-19 18:58:14.000000', 298, 473, 1, 20),
(10, 'Chat Application', 'A real-time chat application allowing users to create chat rooms, send messages, and share files. Built with Socket.IO, Node.js, and React.', 'https://github.com/yourusername/chat-application', 'project10.jpg', 'Intermediate', 'Communication', '2023-12-14 18:58:14.000000', 438, 101, 5, 30),
(11, 'Expense Tracker', 'An app for tracking personal finances and expenses. Users can categorize expenses, set budgets, and view spending trends. Developed using Flutter and Firebase.', 'https://github.com/yourusername/expense-tracker', 'project11.jpg', 'Beginner', 'Finance', '2024-01-22 18:58:14.000000', 60, 193, 3, 35),
(12, 'Music Player', 'A simple yet feature-rich music player application for desktop. Supports playlist management, audio visualization, and customizable themes. Built using Electron and React.', 'https://github.com/yourusername/music-player', 'project12.jpg', 'Intermediate', 'Media & Entertainmen', '2024-02-18 18:58:14.000000', 433, 135, 2, 22),
(13, 'Job Board', 'A platform for posting and applying for job listings. Employers can post job openings, and job seekers can search for and apply to jobs. Developed with Django and React.', 'https://github.com/yourusername/job-board', 'project13.jpg', 'Intermediate', 'Career & Employment', '2024-03-03 18:58:14.000000', 459, 175, 4, 26),
(14, 'Project Management Tool', 'A comprehensive tool for managing projects and tasks within teams. Includes features for task assignment, progress tracking, and file sharing. Built using Laravel and Vue.js.', 'https://github.com/yourusername/project-management-tool', 'project14.jpg', 'Advanced', 'Productivity', '2024-02-26 18:58:14.000000', 298, 150, 3, 31),
(15, 'Quiz App', 'An interactive quiz application with support for multiple-choice questions, quizzes with timers, and scoring. Developed using React Native and Firebase.', 'https://github.com/yourusername/quiz-app', 'project15.jpg', 'Beginner', 'Education', '2023-12-12 18:58:14.000000', 370, 369, 3, 46),
(16, 'Weather App', 'A weather application providing current weather conditions and forecasts for locations worldwide. Built with React Native and integrates with weather APIs.', 'https://github.com/yourusername/weather-app', 'project16.jpg', 'Beginner', 'Weather', '2023-12-18 18:58:14.000000', 180, 385, 5, 2),
(17, 'Recipe Management System', 'A system for managing recipes, including creating, editing, and organizing recipes into categories. Built using Flask and React.', 'https://github.com/yourusername/recipe-management-system', 'project17.jpg', 'Intermediate', 'Food & Cooking', '2023-09-01 18:58:14.000000', 309, 409, 2, 47),
(18, 'E-commerce Platform', 'A full-stack e-commerce platform built with React, Node.js, and MongoDB. Allows users to browse products, add them to cart, and checkout securely.', 'https://github.com/yourusername/ecommerce-platform', 'project18.jpg', 'Intermediate', 'E-commerce', '2023-06-08 18:58:41.000000', 427, 233, 3, 20),
(19, 'Task Management App', 'A task management application with features like creating tasks, assigning them to team members, setting due dates, and tracking progress. Built with Vue.js and Firebase.', 'https://github.com/yourusername/task-management-app', 'project19.jpg', 'Beginner', 'Productivity', '2024-03-26 18:58:41.000000', 235, 441, 1, 47),
(20, 'Social Media Dashboard', 'A social media dashboard for tracking and analyzing social media metrics. Integrates with APIs of popular social media platforms. Built with React, Node.js, and PostgreSQL.', 'https://github.com/yourusername/social-media-dashboard', 'project20.jpg', 'Advanced', 'Analytics', '2023-07-25 18:58:41.000000', 185, 380, 4, 30),
(21, 'Music Recommendation System', 'A system that recommends music based on user preferences and listening history. Utilizes machine learning algorithms such as collaborative filtering. Implemented with Python and scikit-learn.', 'https://github.com/yourusername/music-recommendation-system', 'project21.jpg', 'Advanced', 'Media & Entertainment', '2023-11-17 19:00:51.000000', 363, 363, 2, 44),
(22, 'Language Learning App', 'An application for learning new languages through interactive lessons, quizzes, and vocabulary exercises. Supports multiple languages and proficiency levels. Developed using React Native and Redux.', 'https://github.com/yourusername/language-learning-app', 'project22.jpg', 'Intermediate', 'Education', '2023-11-04 19:00:51.000000', 115, 112, 2, 44),
(23, 'Stock Portfolio Tracker', 'A tool for tracking and analyzing stock portfolios. Users can add stocks, view real-time prices, and analyze portfolio performance with charts and metrics. Built with React, Node.js, and MongoDB.', 'https://github.com/yourusername/stock-portfolio-tracker', 'project23.jpg', 'Intermediate', 'Finance', '2024-04-11 19:00:51.000000', 294, 106, 5, 31),
(24, 'Artificial Intelligence Chess', 'A chess engine implemented with artificial intelligence techniques such as minimax and alpha-beta pruning. Supports various difficulty levels and game modes. Developed using Python and TensorFlow.', 'https://github.com/yourusername/ai-chess', 'project24.jpg', 'Advanced', 'Gaming', '2023-07-18 19:00:51.000000', 83, 288, 3, 26),
(25, 'Virtual Reality Experience', 'An immersive virtual reality experience showcasing interactive environments and simulations. Developed using Unity3D and compatible with popular VR headsets. Requires knowledge of 3D modeling and game development.', 'https://github.com/yourusername/virtual-reality-experience', 'project25.jpg', 'Advanced', 'Virtual Reality', '2023-07-31 19:00:51.000000', 197, 85, 3, 43),
(26, 'Medical Appointment System', 'A system for scheduling and managing medical appointments for clinics or hospitals. Includes features for patient registration, appointment booking, and doctor availability. Built with Django and PostgreSQL.', 'https://github.com/yourusername/medical-appointment-system', 'project26.jpg', 'Intermediate', 'Healthcare', '2023-12-13 19:00:51.000000', 494, 225, 5, 40),
(27, 'Online Code Compiler', 'A platform for compiling and executing code online in various programming languages. Supports features such as syntax highlighting, input/output redirection, and error reporting. Built with Node.js, Express.js, and Docker.', 'https://github.com/yourusername/online-code-compiler', 'project27.jpg', 'Intermediate', 'Programming Tools', '2023-09-15 19:00:51.000000', 471, 199, 5, 13),
(28, 'Home Automation System', 'A system for automating and controlling smart devices in a home environment. Users can remotely monitor and control lights, thermostats, security cameras, and more. Developed using Raspberry Pi, Python, and MQTT protocol.', 'https://github.com/yourusername/home-automation-system', 'project28.jpg', 'Advanced', 'Internet of Things (IoT)', '2023-05-17 19:00:51.000000', 377, 442, 1, 12),
(29, 'Blockchain-based Voting System', 'A secure and transparent voting system built on blockchain technology. Allows voters to cast their votes securely, and results are immutable and tamper-proof. Implemented using Ethereum smart contracts and web3.js.', 'https://github.com/yourusername/blockchain-voting-system', 'project29.jpg', 'Advanced', 'Blockchain', '2023-06-09 19:00:51.000000', 355, 355, 2, 38),
(30, 'Smart Parking System', 'A system for managing parking spaces in urban areas efficiently. Includes features for real-time parking availability tracking, reservation, and payment. Developed using Arduino, ultrasonic sensors, and a web-based dashboard.', 'https://github.com/yourusername/smart-parking-system', 'project30.jpg', 'Intermediate', 'Smart Cities', '2023-10-04 19:00:51.000000', 360, 132, 5, 37),
(31, 'Food Delivery App', 'An app for ordering food from restaurants for delivery or pickup. Users can browse menus, place orders, and track delivery status in real-time. Built with Flutter for cross-platform compatibility and Firebase for backend services.', 'https://github.com/yourusername/food-delivery-app', 'project31.jpg', 'Intermediate', 'Food & Beverage', '2024-03-01 19:00:51.000000', 77, 109, 3, 50),
(32, 'Voice Assistant', 'A virtual assistant capable of performing tasks through voice commands. Supports features such as setting reminders, playing music, and fetching information from the web. Developed using Python and libraries like speech_recognition and pyttsx3.', 'https://github.com/yourusername/voice-assistant', 'project32.jpg', 'Intermediate', 'Artificial Intelligence', '2024-03-29 19:00:51.000000', 295, 379, 1, 47),
(33, 'Real-time Language Translation App', 'An application that translates spoken or written text in real-time to another language. Utilizes machine learning models for natural language processing and translation. Developed using React Native and Google Cloud APIs.', 'https://github.com/yourusername/realtime-language-translation-app', 'project33.jpg', 'Advanced', 'Language & Linguistics', '2023-05-31 19:00:51.000000', 306, 75, 3, 36),
(34, 'Crowdfunding Platform', 'A platform for crowdfunding projects and initiatives. Users can create campaigns, set funding goals, and receive contributions from backers. Built with Ruby on Rails, PostgreSQL, and Stripe for payment processing.', 'https://github.com/yourusername/crowdfunding-platform', 'project34.jpg', 'Intermediate', 'Finance & Funding', '2024-01-09 19:00:51.000000', 429, 79, 4, 41),
(35, 'Online Quiz Game', 'An online multiplayer quiz game where players compete against each other in real-time quizzes. Supports various categories and question types. Developed using Node.js, Socket.IO, and React.', 'https://github.com/yourusername/online-quiz-game', 'project35.jpg', 'Intermediate', 'Gaming', '2023-07-27 19:00:51.000000', 328, 353, 3, 29),
(36, 'Augmented Reality Application', 'An application that overlays digital content onto the real world using augmented reality technology. Users can interact with virtual objects and information in their physical environment. Developed using Unity3D and ARCore/ARKit.', 'https://github.com/yourusername/augmented-reality-app', 'project36.jpg', 'Advanced', 'Augmented Reality', '2023-06-19 19:00:51.000000', 186, 409, 1, 50);
